package day5;

public class Day5Part2 {

	public int execute() {
		String input = "";

		Integer lowest = input.length();
		for (char letter = 'A'; letter <= 'Z'; letter++) {
			String convertedInput = input.replace(String.valueOf(Character.toUpperCase(letter)), "");
			convertedInput = convertedInput.replace(String.valueOf(Character.toLowerCase(letter)), "");
			Integer size = collide(new StringBuilder(convertedInput));
			if (size <= lowest)
				lowest = size;
		}
		return lowest;
	}

	private int collide(StringBuilder input) {
		for (int i = 0; i < input.length() - 1; ) {

			Character a = input.charAt(i);
			Character b = input.charAt(i + 1);
			Boolean capitalFirst;
			Boolean capitalSecond;

			capitalFirst = !a.equals(Character.toLowerCase(a));
			capitalSecond = !b.equals(Character.toLowerCase(a));

			if ((capitalFirst ^ capitalSecond) && (Character.toUpperCase(a) == Character.toUpperCase(b))) {
				input.delete(i, i+2);
				if (i != 0)
					i--;
			}
			else
				i++;
		}
		return input.length();
	}

}


